import React, { useState } from "react";
import { AskQuestions } from "../JSFiles/AskQuestions";
export default function FAQs() {

  const [FAQQuestions, setFAQQuestions] = useState(AskQuestions);

  return (
    <div
      className="div-padding white-bg"
      data-aos="fade-right"
      data-aos-easing="ease-in-sine"
    >
      <div className="container">
        <h2 className="div-heading mt-5" data-aos="flip-left">
          FAQs
        </h2>
        <div className="my-lg-5 my-3">
          <div className="my-3 p-1">
            {
				FAQQuestions.map((currElement) => {
					return currElement.Question;
				})
			}
            <button type="button" className="collapsible fontbolder">
              Tell me about your product?
            </button>
            <div className="FAQContent py-1">
              <p>
                <a href="http://medgic.pk">Medgic.pk</a> is a glabal platform to
                provide healthcare services for men. Our platform allows men of
                all ages to get a fast, convenient and reliable health
                consultation discretely through our official website. We offer a
                panel of doctors and health concerns listed on the webpage,
                anyone from anywhere can take an assessment as per their health
                issue and our doctor expert provides a detailed and personalised
                health plan accordingly with regular follow-ups.
              </p>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}
